(30, 10, 'uz', '\"Lalaku\" trusikchali-tagliklari', '', '', '', '\"Lalaku\" trusikchali-tagliklari', ''),
(4, 4, 'en', 'Lalaku antibacterial face mask', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse sollicitudin ante massa, eget ornare libero porta congue.', '<p>\r\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Suspendisse sollicitudin ante massa, eget ornare libero porta congue. Cras scelerisque dui non consequat sollicitudin. Sed pretium tortor ac auctor molestie. Nulla facilisi. Maecenas pulvinar nibh vitae lectus vehicula semper. Donec et aliquet velit. Curabitur non ullamcorper mauris. In hac habitasse platea dictumst. Phasellus ut pretium justo, sit amet bibendum urna. Maecenas sit amet arcu pulvinar, facilisis quam at, viverra nisi. Morbi sit amet adipiscing ante. Integer imperdiet volutpat ante, sed venenatis urna volutpat a. Proin justo massa, convallis vitae consectetur sit amet, facilisis id libero. \r\n</p>', 'Colors\r\nBody: Blue\r\nEyes: Black\r\nBeak: Orange\r\n\r\nOther\r\nMaterial: Plastic', '', ''),
(31, 11, 'en', '\"Jonny\" pantyhose', '', '', '', '', ''),
(32, 11, 'ru', 'Колготки \"Джонни\"', '', '', '', '', ''),
(33, 11, 'uz', '\"Jonny\" trusikchali-tagliklari', '', '', '', '', ''),
(34, 12, 'en', '\"Jonny\" soles', '', '<p>Children\'s panties \"JONNY\" are specially created from natural materials with the use of advanced technologies, which provide maximum comfort for your child. Children\'s panties \"JONNY\" contain: special top layer with the addition of aloe vera lotion; spetsialnыe materials, obespechivayushchie «dyxanie» nejnoy koji malysha; spetsialno vpityvayushchuyu sistemu, otlichno raspredelyayushchuyu jidkost vnutri i zashchishchayushchuyu ot protekaniya do 10 chasov. Children\'s podguzniki «JONNY» obespechat nadejnuyu zashchitu Vashego baby!\r\n</p><p>\r\n</p><p>Attention! Xranit upakovku v mestax nedostupnyx detyam, zashchishchennыm ot vlagi. Porvannye ili ispolzovannыe podguzniki neobxodimo vybrosit.</p>', '', '', ''),
(6, 4, 'uz', '\"Lalaku\" antibakterial yuz niqobi', '', '', '', '', ''),
(28, 10, 'en', '\"Lalaku\" truss-soles', '', '', '', '\"Lalaku\" truss-soles', ''),
(15, 4, 'ru', 'Антибактериальная маска для лица Lalaku', '', '', '', '', ''),
(16, 6, 'en', 'KN 95 \"Lalaku\" protective face mask (without valve)', '', '<p>Filter face mask KN95 (non-sterile respirator) has good air permeability and does not suffocate,\r\n</p><p>nasal fixative placed inside the mask adapts to the entire nasal structure Ingredients: No tissue\r\n</p><p>hypoallergenic polypropylene with additional filter layer. Avoid odors, dust and personal\r\n</p><p>used as a means of hygiene. Fixation type: rubber earphones. From + 15 ° C in a cool, dark place\r\n</p><p>Keep at a temperature not exceeding +25 ° C. Protect from sunlight. Shelf life: 5 years.</p>', '', 'KN 95 \"Lalaku\" protective face mask (without valve)', ''),
(17, 6, 'ru', 'КН 95 \"Лалаку\" маска для лица защитная (без клапана)', '', '', 'Маска фильтрующая КН95 (респиратор нестерильный) имеет хорошую воздухопроницаемость и не задыхается,\r\nназальный фиксатор, помещенный внутри маски, адаптируется ко всей структуре носа Состав: Без ткани\r\nгипоаллергенный полипропилен с дополнительным фильтрующим слоем. Избегайте запахов, пыли и личных\r\nиспользуется как средство гигиены. Тип крепления: резиновые наушники. От + 15 ° C в прохладном темном месте\r\nХранить при температуре не выше +25 ° С. Беречь от солнечных лучей. Срок годности: 5 лет.', 'КН 95 \"Лалаку\" маска для лица защитная (без клапана)', ''),
(18, 6, 'uz', 'KN 95 \"Lalaku\" himoya yuz niqobi (klapansiz)', '', '', 'Filtrli yuz niqobi KN95 (sterillanmagan respirator) yaxshi havo otqazish hususiyatiga ega va nafasni siqmaydi, \r\nniqob ichida joylashtirilgan burun fiksatori barcha burun tuzilishiga moslashtirilgan Tarkibi: No to‘qima \r\ngipoallergen polipropilen qo‘shimcha filtrlovchi qavati bilan. Hidlardan, changlardan saqlanish va shaxsiy \r\ngigiena vositasi sifatida foydalaniladi. Fiksatsiya turi: rezina quloqchin. Salqin va qorong‘u joyda +15°C dan \r\n+25°C dan yuqori bo‘lmagan joyda saqansin. Quyosh nuridan saqlansin. SAQLASH MUDDATI: 5 yil.', 'KN 95 \"Lalaku\" himoya yuz niqobi (klapansiz)', ''),
(39, 13, 'uz', '\"Sahara\" tagliklari', '', '<p>\"SAHARA\" bolalar bezi bezi uchun eng qulay sharoitlarni yaratish uchun zamonaviy texnologiyalardan foydalangan holda tabiiy materiallardan yaratilgan. \"SAHARA\" bolalar tagliklari quyidagilarni o\'z ichiga oladi: aloe vera losoni qo\'shilgan maxsus yuqori qatlam; chaqaloqning nozik terisini \"nafas olishini\" ta\'minlaydigan maxsus materiallar; ichidagi suyuqlikni mukammal taqsimlaydigan va 10 soatgacha oqishdan saqlaydigan maxsus yutuvchi tizim. \"SAHARA\" bolalar bezi bezi sizning chaqalog\'ingiz uchun ishonchli himoya qiladi!\r\n</p><p>\r\n</p><p>Diqqat! Paketni bolalar yeta olmaydigan joyda saqlang, namlikdan saqlaning. Yirtilgan yoki ishlatilgan tagliklarni tashlash kerak.</p>', '', '', ''),
(38, 13, 'ru', 'Низ \"Сахара\"', '', '<p>Детские подгузники «SAHARA» специально созданы из натуральных материалов с использованием передовых технологий, чтобы обеспечить максимальный комфорт для Вашего ребенка. Детские подгузники «SAHARA»  содержат: специальный верхний слой с добавлением лосьона алоэ вера; специальные материалы, обеспечивающие «дыхание» нежной кожи малыша; специально впитывающую систему, отлично распределяющую жидкость внутри и защищающую от протекания до 10 часов. Детские подгузники «SAHARA» обеспечат надежную защиту Вашего малыша!\r\n</p><p>\r\n</p><p>Внимание! Хранить упаковку в местах недоступных детям, защищенным от влаги. Порванные или использованные подгузники необходимо выбросить.</p>', '', '', ''),
(37, 13, 'en', '\"Sahara\" bottoms', '', '<p>\"SAHARA\" baby diapers are specially created from natural materials using advanced technologies to provide maximum comfort for your baby. \"SAHARA\" baby diapers contain: a special top layer with the addition of aloe vera lotion; special materials that ensure the \"breathing\" of the baby\'s delicate skin; a specially absorbent system that perfectly distributes liquid inside and protects against leaks for up to 10 hours. Baby diapers \"SAHARA\" will provide reliable protection for your baby!\r\n</p><p>\r\n</p><p>Attention! Keep packaging out of the reach of children, protected from moisture. Torn or used diapers should be thrown away.</p>', '', '', ''),
(36, 12, 'uz', '\"Jonny\" tagliklari', '', '<p>Detskie poduzniki «JONNY» ixtisoslashtirilgan sozdani tabiiy materiallar s ispolzovaniem peredovyh texnologiyali, chtoby obstrechit maksymalnyy komfort dlya Vashego rebenka. Detskie poduzniki «JONNY» soderjat: spetsialnyy verxniy sloy s dobavleniyem lyona aloe vera; maxsus materiallar, obsesvivayushchie «dyhanie» nejnoy koji malysha; spetsialno vpitivayushchuyu tizimu, otlichno raspredelyayushchuyu jidkost vnutri i zashchishayushchuyu ot protekaniya do 10 chasov. Detskie poduzniki «JONNY» obspechat nadejnuyu zashchitu Vashego malysha!\r\n</p><p>\r\n</p><p>Vnimanie! Xranit upakovku v mestax nedostupnyx detyam, zashishchennym ot vlagi. Portvannye ili ispolzovannye podguzniki neobxodimo vybrosit.</p>', '', '', ''),
(35, 12, 'ru', 'Подошвы \"Джонни\"', '', '<p>Детские подгузники «JONNY» специально созданы из натуральных материалов с использованием передовых технологий, чтобы обеспечить максимальный комфорт для Вашего ребенка. Детские подгузники «JONNY»  содержат: специальный верхний слой с добавлением лосьона алоэ вера; специальные материалы, обеспечивающие «дыхание» нежной кожи малыша; специально впитывающую систему, отлично распределяющую жидкость внутри и защищающую от протекания до 10 часов. Детские подгузники «JONNY» обеспечат надежную защиту Вашего малыша!\r\n</p><p>\r\n</p><p>Внимание! Хранить упаковку в местах недоступных детям, защищенным от влаги. Порванные или использованные подгузники необходимо выбросить.</p>', '', '', ''),
(25, 9, 'en', 'KN 95 \"Lalaku\" protective face mask (with flaps)', '', '', 'Filter face mask KN95 (non-sterile respirator) has good air permeability and does not suffocate,\r\nnasal fixative placed inside the mask adapts to the entire nasal structure Ingredients: No tissue\r\nhypoallergenic polypropylene with additional filter layer. Avoid odors, dust and personal\r\nused as a means of hygiene. Fixation type: rubber earphones. From + 15 ° C in a cool, dark place\r\nKeep at a temperature not exceeding +25 ° C. Protect from sunlight. Shelf life: 5 years.', 'KN 95 \"Lalaku\" protective face mask (with flaps)', ''),
(26, 9, 'ru', 'КН 95 \"Лалаку\" маска для лица защитная (клапана)', '', '', 'Маска фильтрующая КН95 (респиратор нестерильный) имеет хорошую воздухопроницаемость и не задыхается,\r\nназальный фиксатор, помещенный внутри маски, адаптируется ко всей структуре носа Состав: Без ткани\r\nгипоаллергенный полипропилен с дополнительным фильтрующим слоем. Избегайте запахов, пыли и личных\r\nиспользуется как средство гигиены. Тип крепления: резиновые наушники. От + 15 ° C в прохладном темном месте\r\nХранить при температуре не выше +25 ° С. Беречь от солнечных лучей. Срок годности: 5 лет.', 'КН 95 \"Лалаку\" маска для лица защитная (с клапанами)', ''),
(27, 9, 'uz', 'KN 95 \"Lalaku\" himoya yuz niqobi (klapanli)', '', '', 'Filtrli yuz niqobi KN95 (sterillanmagan respirator) yaxshi havo otqazish hususiyatiga ega va nafasni siqmaydi, \r\nniqob ichida joylashtirilgan burun fiksatori barcha burun tuzilishiga moslashtirilgan Tarkibi: No to‘qima \r\ngipoallergen polipropilen qo‘shimcha filtrlovchi qavati bilan. Hidlardan, changlardan saqlanish va shaxsiy \r\ngigiena vositasi sifatida foydalaniladi. Fiksatsiya turi: rezina quloqchin. Salqin va qorong‘u joyda +15°C dan \r\n+25°C dan yuqori bo‘lmagan joyda saqansin. Quyosh nuridan saqlansin. SAQLASH MUDDATI: 5 yil.', 'KN 95 \"Lalaku\" himoya yuz niqobi (klapanli)', ''),
